import logo from './logo.svg';
import './App.css';
import axios from 'axios';

const api = axios.create({
  baseURL:"https://run.mocky.io/v3/5c6fec2a-c35f-4378-ac29-3d4685d02d2e"
})

function App() {
  return (
    api.get('/').then(res => {
      console.log(res.data)
    })
  );
}

export default App;
